import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Coffee Matches
        </p>
        <a
          className="App-link"
          href="https://www.coffeematches.com/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Referal Hub
        </a>
      </header>
    </div>
  );
}

export default App;
